    {ntt"total": 7,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-06T22:00:40.531824",nt"name": "high-transparent-metal-oxide-polyimide-antistatic-coatings-project",nt"isopen":
    true,nt"url": null,nt"notes": "NASA requires clear antistatic coatings
    that can withstand exposure to the rigors of the space environment. Agiltron proposes
    a coating consisting of inorganic conducting particles and space environment resistant
    polymer that shares the best features of inorganics and organics currently available.
    Such a coating could potentially be processed by common polymeric routes yet have
    the optical/electrical performance advantages of inorganic materials. The electric
    resistance of the coating can be easily adjusted by changing the composition and
    concentration of the inorganic conducting particles for a resistance required for
    antistatic applications (106-1010 ohm/sq). This new material system would overcome
    traditional drawbacks, such as the light scattering due to the aggregation of the
    inorganic particles, providing the high transparency and desired conductivity for
    many applications. Elimination of light scattering is achieved by dispersing transparent
    conducting particles into an optically matched polymer matrix. Moreover, the transparent
    and conducting particles are designed to chemically bond to the engineered polymer
    composite for excellent stability and reliability that are required in space environment
    applications. The process of applying this type of transparent antistatic film is
    as simple as applying paint, which would allow the application of these coatings
    to flexible and rigid materials suggesting potential even in very cost-sensitive
    applications.  ",nt"license_title": "U.S. Government Work",nt"extras":
